import React, { Component } from 'react';
import { Table } from 'antd';
import IMG01 from '../../../assets/images/doctor-thumb-01.jpg';

class TableJobs extends Component {

  render() {
    const { data } = this.props

    const columns = [
      {
        title: 'Job Title',
        dataIndex: 'title',
        render: (text, { image }) => {
          const url = image ? `http://excodeteam.com/crs/public/images/${image}` : IMG01;
          return (
            <h2 className="table-avatar">
              <a href="/admin/profile" className="avatar avatar-sm mr-2"><img alt="" src={url} /></a>
              <a href="/admin/profile">{text.substr(0, 30)}</a>
            </h2>
          )
        }
      },
      {
        title: 'Employer',
        dataIndex: 'employer',
        render: ({ name, photo }) => {
          const url = photo ? `http://excodeteam.com/crs/public/images/${photo}` : IMG01;
          return (
            <h2 className="table-avatar">
              <a href="/admin/profile" className="avatar avatar-sm mr-2"><img alt="" src={url} /></a>
              <a href="/admin/profile">{name}</a>
            </h2>
          )
        }
      },
      {
        title: 'Employer',
        dataIndex: 'employer',
        render: ({ name, photo }) => {
          const url = photo ? `http://excodeteam.com/crs/public/images/${photo}` : IMG01;
          return (
            <h2 className="table-avatar">
              <a href="/admin/profile" className="avatar avatar-sm mr-2"><img alt="" src={url} /></a>
              <a href="/admin/profile">{name}</a>
            </h2>
          )
        }
      },
    ]

    return (
      <div>
        <Table className="table-striped"
          style={{ overflowX: 'auto' }}
          columns={columns}
          // bordered
          dataSource={data}
          rowKey={record => record.id}
          pagination={false}
        />
      </div>

    )
  }
};

export default TableJobs;
